import ProjectDetails from './App/Pages/ProjectDetails';


function App() {
  return (
    <div className="App">
      <Nav/>
        <Home/> 
     <ProjectDetails/> 
     <WeeklyUpdate/>
    </div>
  );
}

export default App;
